import { useState } from "react";

const Home = () => {

    const [messengers, setMessengers] = useState([
        {title: 'General', body: 'test1', creator: 'EquityCats', id: 1},
        {title: 'Discussion', body: 'test2', creator: 'EquityCats', id: 2},
        {title: 'Testing', body: 'test3', creator: 'EquityCats', id: 3}
    ]);

    return (
        <div className="home">
            <h2>Home</h2>
            {messengers.map((m) => (
                <div className="messenger-preview" key={m.id}>
                    <h2>{ m.title }</h2>
                    <p>Creator: { m.creator }</p>
                </div>
            ))}
        </div>
    );
}
 
export default Home;
